import React, {useState } from 'react';
import {ResumeContainer, ResumeWrapper, ResumeContact, newLine} from './resumeElements';
import Navbar from "../../components/nav/navbar";
import Dropdown from '../../components/dropdown/dropdown';
import Footer from '../../components/footer/index';

const Resume = () => {
    const [isOpen, setIsOpen] = useState(false);

    const toggle = () => {
    setIsOpen(!isOpen);
  }
    return (

            <ResumeContainer>
                <Dropdown isOpen={isOpen} toggle={toggle} />
                <Navbar toggle={ toggle } />
                <ResumeWrapper>
                    <ResumeContact> 
                        <text>
                            <h2> Emma Robyn Barua {"\n"} </h2> 
                            <h4> Makeup Artist Trainee {"\n"} ScreenSkills Film Trainee 2020-21 </h4>
                            <h3>  {"\n"}
                            Brighton and London based, willing to travel. {"\n"}
                            M: 07449 203 870 E: emma@thegalaxygirl.co.uk {"\n"}
                            </h3>

                        </text>
                    </ResumeContact>
                </ResumeWrapper>

                <Footer/>
            </ResumeContainer>

    )
}

export default Resume
